import React from 'react';
import Navigation from './Components/UI/Navigation';
import Footer from './Components/UI/Footer';
import Home from './Components/Pages/Home';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Contact from './Components/Pages/Contact';
import Services from './Components/Pages/Services';
import Warehousing from './Components/Pages/Warehousing';
import Fulfillment from './Components/Pages/Fulfillment';
import Shipping from './Components/Pages/Shipping';

import './App.css';
import Locations from './Components/Pages/Locations';

function App() {

  const titleLogo = {
    backgroundImage: `url(${titleImage})`,
    width: "100%",
    height: "900px",
    opacity: "0.5",
    backgroundPosition: 'center',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat'
  };

  return (
    <BrowserRouter>
    <div className="main-container">
      <Navigation />
      {/* <div className='title-bg' style={titleLogo}>
        <h1 className='title'>
          Logistics Made Simple.
        </h1>
      </div> */}
      <Routes>
          <Route path="/" element={<Home />}/>
          <Route path="/Locations" element={<Locations />}/>
          <Route path="/services" element={<Services />}/>
          <Route path="/contact" element={<Contact />}/>
          <Route path="/Warehousing" element={<Warehousing isInNewTab={window.opener !== null}/>}/>
          <Route path="/Shipping" element={<Shipping />}/>
          <Route path="/Fulfillment" element={<Fulfillment />}/>
       </Routes>
      <Contact></Contact>
      <Footer></Footer>
    </div>
    </BrowserRouter>
  );
}

export default App;
